  CONSTRAINT `listen_ibfk_3` FOREIGN KEY (`idPodcast`) REFERENCES `podcast` (`id`),
  CONSTRAINT `EitherForeignKeyIsNull` CHECK ((((`idSong` is null) and (`idPodcast` is not null)) or ((`idSong` is not null) and (`idPodcast` is null))))
) ENGINE=InnoDB AUTO_INCREMENT=2027 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
